    "2015-09-26T23:43:28.596538",nt"name": "shallow-water-benthic-habitats-of-the-northwestern-hawaiian-islands-from-aggregated-habitat-cov",nt"isopen":
    false,nt"url": null,nt"notes": "Shallow-water, aggregated cover maps were
    produced by combining as many as four or more detailed habitat types into general
    cover categories. The original detailed habitat maps were produced by rule-based,
    semi- automated image analysis of high-resolution satellite imagery for nine locations
    in the Northwestern Hawaiian Islands. This project is a cooperative effort between
    the National Oceanic and Atmospheric Administration, State of Hawaii Department
    of Land and Natural Resources, and the U.S. Fish and Wildlife Service to produce
    benthic habitat maps and georeferenced imagery for the Northwestern Hawaiian Islands.
    This project was conducted in support of the U.S. Coral Reef Task Force.",nt"license_title":
